import { useParams } from 'react-router-dom';
import { useState } from 'react';
import { useFetch } from 'usehooks-ts';
import { getURI, API } from '../../services';
import { StatusPilot } from '../../components/StatusPilot';

interface IPilotDetails {
  id?: number;
  userId: number;
  firstName: string;
  lastName: string;
  cpf: string;
  cellphone: string;
  email: string;
  status: string;
}

interface PilotDetailsProps {
  pilot: IPilotDetails;
}

export const AdminStatus = ({ pilot: initialPilot }: PilotDetailsProps) => {
  const { userId } = useParams<{ userId: any }>();
  const [pilot, setPilot] = useState<IPilotDetails | null>(null);
  const {
    data: pilotData,
    error: pilotError,
  } = useFetch<IPilotDetails>({
    url: getURI(`${API.pilots}/${userId}`)
  });


  return (
    <div>
      <StatusPilot userId={0} currentStatus={''} onStatusChange={function (newStatus: string): void {
        throw new Error('Function not implemented.');
      }} />
    </div>
  );
}
